import React from "react";
import { NavLink } from "react-router-dom";

// Need to style these as items in the navbar
// Maybe add an Icon for each NavbarItem
const NavbarItem = (props) => {
  return (
    <div className="content-center">
      {/* Add Icon here */}
      <NavLink to={props.onTo}>
        <button className="bg-blue-500 hover:-translate-y-1 hover:scale-105 hover:bg-indigo-500 duration-300 text-white font-bold py-2 px-4 rounded-lg transition ease-in-out delay 150">
          {props.title}
        </button>
      </NavLink>
    </div>
  );
};

export default NavbarItem;
